-- ----------------------------
-- Table structure for t_account_bind_item
-- ----------------------------
DROP TABLE IF EXISTS `t_account_bind_item`;
CREATE TABLE `t_account_bind_item`  (
  `item_id` int(11) NOT NULL COMMENT '设备ID',
  `item_name` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '设备名称',
  `item_no` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '设备编号',
  `item_type` tinyint(4) NOT NULL DEFAULT 1 COMMENT '设备类型 1：单相表 2：三相表',
  `meter_state` tinyint(4) NOT NULL DEFAULT 1 COMMENT '状态: 0 故障 1 正常',
  `meter_location` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '设备地理安装位置',
  `meter_rate` int(11) NULL DEFAULT 1 COMMENT '表具倍率',
  `account_id` bigint(64) NOT NULL COMMENT '账户ID',
  `account_no` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '账户编号',
  `account_name` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '账户名称',
  `initial_meter_value` decimal(14, 2) NULL DEFAULT 0.00 COMMENT '起始电表读数, 单位:kWh',
  `bill_type` tinyint(4) NULL DEFAULT 0 COMMENT '计费方式 0：平均计价 1：分时段计价',
  `unit_price` decimal(14, 2) NULL DEFAULT NULL COMMENT '平均计价电费单价，单位：元(=归属物业单价+平台手续费单价)',
  `belong_tenement_unit_price` decimal(14, 2) NULL DEFAULT NULL COMMENT '归属物业单价，单位：元',
  `platform_fee_unit_price` decimal(14, 2) NULL DEFAULT NULL COMMENT '平台手续费单价，单位：元',
  `bill_flag` tinyint(4) NULL DEFAULT 1 COMMENT '是否计费： 0:否 1：是',
  `bind_status` tinyint(4) NULL DEFAULT 1 COMMENT '绑定状态  0:解绑; 1:绑定;',
  `remark` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '备注',
  `creator` bigint(64) NULL DEFAULT NULL COMMENT '创建者',
  `create_date` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `updater` bigint(64) NULL DEFAULT NULL COMMENT '更新者',
  `update_date` datetime NULL DEFAULT NULL COMMENT '更新时间',
  `dept_id` bigint(64) NULL DEFAULT NULL COMMENT '系统用户部门Id',
  `tenant_code` bigint(64) NULL DEFAULT NULL COMMENT '系统租户Id',
  UNIQUE INDEX `uk_item_account`(`item_id`, `account_no`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '缴费账户-设备绑定关系表' ROW_FORMAT = Dynamic;

