-- Table structure for t_account_change_record
-- ----------------------------
DROP TABLE IF EXISTS `t_account_change_record`;
CREATE TABLE `t_account_change_record`  (
  `id` bigint(20) NOT NULL,
  `trans_seq` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '业务流水号',
  `account_id` bigint(64) NOT NULL COMMENT '账户ID',
  `account_no` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '账户编号',
  `account_name` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '账户名称(租户名/商店名)',
  `request_echo` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '请求方回填信息',
  `trans_type` int(11) NULL DEFAULT 0 COMMENT '交易类型(0:加款 1：减款)',
  `trans_detail` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '交易明细',
  `amount` decimal(14, 2) NOT NULL DEFAULT 0.00 COMMENT '变动金额， 单位：元',
  `expire_time` datetime NULL DEFAULT NULL COMMENT '交易失效时间，超过此时间后，交易失败不加减余额',
  `remark` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '备注',
  `trans_result` int(11) NOT NULL COMMENT '交易处理结果: -1-待处理 0-成功 1-失败',
  `trans_result_desc` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '结果说明',
  `source` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '来源',
  `tenant_code` bigint(64) NULL DEFAULT NULL COMMENT '租户id',
  `create_date` datetime NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_date` datetime NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后修改时间',
  `creator` bigint(64) NULL DEFAULT NULL COMMENT '创建者',
  `creator_name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL,
  `updater` bigint(64) NULL DEFAULT NULL COMMENT '更新者',
  `updater_name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `uk_ts_tc`(`trans_seq`, `tenant_code`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '余额变更请求明细记录' ROW_FORMAT = Dynamic;

