DROP TABLE IF EXISTS `t_item`;
CREATE TABLE `t_item`  (
  `item_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '设备ID',
  `item_name` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '设备名称',
  `item_no` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '设备表具编号',
  `item_type` tinyint(4) NOT NULL DEFAULT 1 COMMENT ' 1：单相表 2：三相三线表 3：三相四线表 4：倍率表',
  `sub_system` tinyint(4) NULL DEFAULT 0 COMMENT '所属子系统：0: 供配电; 1: 空调系统; 2: 给排水; 3: 照明; 4：电梯; 5：消防',
  `energy_type` tinyint(4) NOT NULL DEFAULT 0 COMMENT '用能类型：0：电 1：水 2：暖',
  `meter_state` tinyint(4) NOT NULL DEFAULT 0 COMMENT '状态: 0正常  1故障',
  `bind_state` tinyint(4) NOT NULL DEFAULT 0 COMMENT '绑定状态: 0 未绑定; 1 已绑定',
  `meter_level` tinyint(4) NOT NULL DEFAULT 1 COMMENT '计量等级: 1一级 2二级 3三级',
  `meter_location` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '设备地理安装位置',
  `meter_rate` int(11) NULL DEFAULT 1 COMMENT '表具倍率',
  `remark` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '备注',
  `creator` bigint(64) NULL DEFAULT NULL COMMENT '创建者',
  `create_date` datetime NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `updater` bigint(64) NULL DEFAULT NULL COMMENT '更新者',
  `update_date` datetime NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `dept_id` bigint(64) NULL DEFAULT NULL COMMENT '系统用户部门Id',
  `tenant_code` bigint(64) NULL DEFAULT NULL COMMENT '系统租户Id',
  `project_id` bigint(64) NULL DEFAULT NULL COMMENT '项目id',
  `project_name` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '项目名称',
  PRIMARY KEY (`item_id`) USING BTREE,
  INDEX `item_no_index`(`item_no`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 456522981 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '设备表' ROW_FORMAT = Dynamic;

