  `id` bigint(64) NOT NULL AUTO_INCREMENT,
  `item_id` int(11) NOT NULL COMMENT '设备ID',
  `item_name` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '设备名称',
