  `pay_date` datetime NOT NULL COMMENT '充值日期',
  `pay_state` tinyint(4) NOT NULL COMMENT '充值状态 0：待支付 1：支付成功 2：支付失败 3：取消支付 4：异常',
  `remark` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '备注',
  `item_id` int(11) NULL DEFAULT NULL COMMENT '设备ID',
  `item_name` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '设备名称',
  `item_type` varchar(16) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT 'METER' COMMENT '设备类型，默认METER',
  `energy_type` tinyint(4) NOT NULL DEFAULT 0 COMMENT '能耗类型：0：电 1：水 2：暖',
  `meter_address` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '设备编号(表地址)',
  `create_date` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_date` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `creator` bigint(64) NULL DEFAULT NULL COMMENT '创建者',
  `creator_name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL,
  `updater` bigint(64) NULL DEFAULT NULL COMMENT '更新者',
  `updater_name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL,
  `tenant_code` bigint(64) NULL DEFAULT NULL COMMENT '租户id',
  `project_id` bigint(64) NOT NULL COMMENT '项目id',
  `project_name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '项目名称',
  `pay_type` tinyint(1) NOT NULL DEFAULT 0 COMMENT '支付方式：0微信1支付宝',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `uk_pay_serial_num`(`pay_serial_num`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1504427694124290051 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '账户缴费充值记录表' ROW_FORMAT = Dynamic;

