-- ----------------------------
-- Table structure for t_payment_account
-- ----------------------------
DROP TABLE IF EXISTS `t_payment_account`;
CREATE TABLE `t_payment_account`  (
  `id` bigint(64) NOT NULL COMMENT '账户ID',
  `account_no` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '账户编号',
  `merchant_tenant_id` bigint(20) NOT NULL COMMENT '商家租户id',
  `merchant_tenant_name` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '租户名(商店名)',
  `account_type` tinyint(4) NOT NULL DEFAULT 0 COMMENT '账户类型 0:预付费 1:后付费',
  `account_state` tinyint(4) NOT NULL DEFAULT 1 COMMENT '状态: 0停用 1启用',
  `remain` decimal(14, 2) NOT NULL DEFAULT 0.00 COMMENT '账户余额， 单位：元',
  `overdraft_limit` decimal(14, 2) NULL DEFAULT NULL COMMENT '透支额度 单位：元',
  `shortmessage_notice_threshold` decimal(14, 2) NULL DEFAULT NULL COMMENT '短信通知的余额阈值, 单位：元',
  `remark` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '备注',
  `project_id` bigint(20) NOT NULL COMMENT '项目id',
  `project_name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '项目名称',
  `data_status` tinyint(4) NOT NULL DEFAULT 0 COMMENT '是否删除：0否 1是',
  `creator` bigint(64) NULL DEFAULT NULL COMMENT '创建者',
  `create_date` datetime NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `updater` bigint(64) NULL DEFAULT NULL COMMENT '更新者',
  `update_date` datetime NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `version` bigint(64) NULL DEFAULT 0 COMMENT '余额版本号',
  `dept_id` bigint(64) NULL DEFAULT NULL COMMENT '系统用户部门Id',
  `tenant_code` bigint(64) NULL DEFAULT NULL COMMENT '租户id',
  `contact1_name` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '联系人1姓名(短信通知使用)',
  `contact1_mobile` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '联系人1手机号(短信通知使用)',
  `account_add` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '账户地址(房源地址,短信通知使用)',
  `open_id` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '微信用户openid',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `uk_account`(`account_no`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '商家缴费账户表' ROW_FORMAT = Dynamic;

