-- ----------------------------
-- Table structure for ts_kv
-- ----------------------------
DROP TABLE IF EXISTS `ts_kv`;
CREATE TABLE `ts_kv`  (
  `entity_id` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT 'entity_id',
  `key_k` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT 'key',
  `ts` bigint(64) NOT NULL COMMENT 'ts',
  `dbl_v` decimal(64, 2) NULL DEFAULT 0.00 COMMENT 'dbl_v',
  PRIMARY KEY (`entity_id`, `key_k`, `ts`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '全量电表数据' ROW_FORMAT = Dynamic PARTITION BY LINEAR HASH (ts)
PARTITIONS 10
